class Solution(object):
    def dailyTemperatures(self, temperatures):
        """
        :type temperatures: List[int]
        :rtype: List[int]
        """
        temp = {}
        result = [0]*len(temperatures)
        for x in range(len(temperatures)-1, -1, -1):
            val = temperatures[x]
            temp[val] = x
            local_max = len(temperatures)+1
            for y in range(val+1, 101):
                if y in temp:
                    local_max = min(local_max, temp[y]-x)
            if local_max != (len(temperatures)+1):
                result[x] = local_max
        return result


